import React from 'react';
import { Formik, Form } from 'formik'
import FormikControl from '../FormikControl/FormikControl'
import * as Yup from 'yup'
import {Button} from '@chakra-ui/react'

function StudentRegister() {

    const initialValues = {
        "name": "",
        "enrollmentNo": "",
        "facultyNo": "",
        "courseName": "",
        "courseCode": "",
        "registrationMode": ""
    }

    const onSubmit = values => {
        console.log(values);
    }

    const validationSchema = Yup.object({

    })

    return (

        <Formik initialValues={initialValues} onSubmit={onSubmit} validationSchema={validationSchema}>
            {
                (formik) => {
                    return (
                        <Flex>

                        <Form>
                            <FormikControl control='input' label='Name' name='name' type='text'></FormikControl>
                            <FormikControl control='input' label='Enrollment No' name='enrollmentNo' type='text'></FormikControl>
                            <FormikControl control='input' label='Faculty No' name='facultyNo' type='text'></FormikControl>
                            <FormikControl control='input' label='Email' name='email' type='email'></FormikControl>
                            <FormikControl control='input' label='Phone No' name='name' type='number'></FormikControl>
                            <FormikControl control='input' label='Course Name' name='courseName' type='text'></FormikControl>
                            <Button colorScheme='teal' size='md'>Submit</Button>
                        </Form>
                        </Flex>
                    )
                }
            }
        </Formik>

    )
}

export default StudentRegister







